
CREATE TABLE arrondissement (
    id integer NOT NULL,
    geom public.geometry(MultiPolygon,2989),
    id_geofla character varying(24),
    code_arr character varying(1),
    code_chf character varying(3),
    nom_chf character varying(50),
    x_chf_lieu integer,
    y_chf_lieu integer,
    x_centroid integer,
    y_centroid integer,
    code_dept character varying(2),
    nom_dept character varying(30),
    code_reg character varying(2),
    nom_reg character varying(35)
);


CREATE TABLE canton (
    id integer NOT NULL,
    geom public.geometry(MultiPolygon,2989),
    id_geofla character varying(24),
    code_cant character varying(2),
    code_chf character varying(3),
    nom_chf character varying(50),
    x_chf_lieu integer,
    y_chf_lieu integer,
    x_centroid integer,
    y_centroid integer,
    code_arr character varying(1),
    code_dept character varying(2),
    nom_dept character varying(30),
    code_reg character varying(2),
    nom_reg character varying(30)
);


CREATE TABLE commune (
    id integer NOT NULL,
    geom public.geometry(MultiPolygon,2989),
    id_geofla character varying(24),
    code_com character varying(3),
    insee_com character varying(5),
    nom_com character varying(50),
    statut character varying(25),
    x_chf_lieu integer,
    y_chf_lieu integer,
    x_centroid integer,
    y_centroid integer,
    z_moyen integer,
    superficie bigint,
    population bigint,
    code_arr character varying(1),
    code_dept character varying(2),
    nom_dept character varying(30),
    code_reg character varying(2),
    nom_reg character varying(35)
);


CREATE TABLE departement (
    id integer NOT NULL,
    geom public.geometry(MultiPolygon,2989),
    id_geofla character varying(24),
    code_dept character varying(2),
    nom_dept character varying(30),
    code_chf character varying(3),
    nom_chf character varying(50),
    x_chf_lieu integer,
    y_chf_lieu integer,
    x_centroid integer,
    y_centroid integer,
    code_reg character varying(2),
    nom_reg character varying(35)
);

